199	100	46	TomTom Multi-Sport Cardio	Innovative Technologie Erhalten Sie genaue Informationen zu Ihrer Herzfrequenz, ohne einen separaten Brustgurt tragen zu müssen. Ihre Herzfrequenz wird mithilfe eines Sensors in der Uhr gemessen, der Änderungen des Blutflusses an Ihrem Handgelenk feststellt. Dabei wird Licht durch die Haut geleitet, um Veränderungen bei den Lichtreflexionen festzustellen. Sehen Sie Echtzeitinformationen zu Ihrem Lauf, Ihrer Rad- und Schwimmeinheit auf einen Blick. Verfolgen Sie Ihre Distanz, Zeit, Ihr Tempo, Ihre Geschwindigkeit und Ihre verbrannten Kalorien während des Trainings auf einem extragroßen Display. Unabhängige Tests ergaben, dass der eingebaute Herzfrequenzmesser im Vergleich zur Elektrokardiografie „extrem präzise“ arbeitet. Die Überwachung der Herzfrequenz ist die beste Methode, um zu verstehen, wie Ihr Körper auf das Training reagiert.	[]	t	2017-05-31 12:01:21.454037	2017-05-31 12:01:21.454057
